import React from 'react'

const Suggestions = (props) => {
  const options = props.results.map(account => (
    <button style={{display:'block', minWidth: '230px'}} type='submit' key={account.id} value={account}>
      {`${account.first_name} ${account.last_name}`}
    </button>
  ))
  return <form style={{display:'block'}} onSubmit={props.submit}>{options}</form>
}

export default Suggestions
